import React, { useState } from 'react';




export default function Todo() {
    const [todos, setTodos] = useState([
        // useState가 
        { id: 1, text: '청소하기' },
        { id: 2, text: '공부하기' },
    ]);

    return (
        <div>
            <h2>할 일 목록</h2>
            <ul>
                {todos.map(todo => (  
                    // map으로 리스트 li 생성할 때는 key 꼭 넣기 
                    <li key={todo.id}>{todo.text}</li>
                ))}
            </ul>
        </div>
    );
}
